import { StyleSheet } from "react-native";

const customstyles = StyleSheet.create({
    mt_5:{
        marginTop:5,
    },
    mt_10:{
        marginTop:10,
    },
    mt_20:{
        marginTop:20,
    },
    mr_5:{
        marginRight:5,
    },
    mr_10:{
        marginRight:10,
    },
    ml_5:{
        marginLeft:5,
    },
    ml_10:{
        marginLeft:10,
    },
    my_10:{
        marginVertical:10,
    },
    mh_10:{
        marginHorizontal:10,
    },
    p_20:{
        padding:20
    },
    textbold_800:{
        fontWeight:800,
    },
    grid:{
        flexDirection:'row',
    },
    space_between:{
         justifyContent:"space-between",
    },
    wrap:{
        flexWrap:"wrap",
    }
});


export default customstyles;
